import Rating from '@material-ui/lab/Rating';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box'
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import { withStyles } from '@material-ui/core/styles';


const StyledRating = withStyles({
  iconFilled: {
    color: 'black',
  },
  iconHover: {
    color: 'black',
  },
})(Rating);

function FruitRating ({fruit, updateFruit}) {
  return (<div className='star__rating'>
  <Box component="fieldset" mb={3} borderColor="transparent" className='star__box'>
    <Typography component="legend">Rate the fruit character of the wine</Typography>
    <StyledRating
      name="fruit"
      precision={0.5}
      value={fruit}
      icon={<FiberManualRecordIcon fontSize="inherit" />}
      onChange={(event, newValue) => updateFruit(event, newValue)}
    />
  </Box>
</div>)
}

export default FruitRating
